export const photoSlice = createSlice({
  name: "photo",
  initialState,
  reducers: {
    toggleLike: (state, { payload }) => {
      state = state.map(photo => {
        if (photo.id === payload) photo.like = !photo.like;
        return photo;
      });
    },
  }
});
